import sys, re

query = sys.argv[1]
match = re.search(r'[\w\.-]+@[\w\.-]+', query)
resp = "";
if query.find("/") > -1 or match == None:
	resp = query
else:
	resp = match.group(0)

sys.stdout.write(resp)

