#!/usr/bin/python # encoding: utf-8 import sys from workflow import Workflow, ICON_WARNING, ICON_SETTINGS
def main(wf): text = sys.argv[1]
wf.add_item(title="Store: '"+text+"'", subtitle="Enter your key in the field above", arg=text, valid='True', icon=ICON_SETTINGS) # Skip encryption wf.add_item(title="I don't want encryption", subtitle="If not enabled the communication to Pushbullet/your phone will not be encrypted!", arg="False", valid=True, icon=ICON_WARNING) wf.send_feedback()
