#!/usr/bin/python # encoding: utf-8 import sys sys.path.append('./pushbullet') sys.path.append('./websocket') from pushbullet import Pushbullet from workflow import Workflow, ICON_ERROR
def main(wf): #Get API api = wf.stored_data('bp-api')
pb = Pushbullet(api)
devices = pb.devices
foundHasSMS = False
for index in range(len(devices)): if vars(devices[index]).get("has_sms"): wf.add_item(title=vars(devices[index]).get("nickname"), arg=vars(devices[index]).get("nickname"), valid='True', icon='sms.png') foundHasSMS = True
if foundHasSMS == False: wf.add_item(title="No valid phone is registered in Pushbullet", subtitle="Only available for Android devices. Make sure that SMS sync is enabled", valid=False, icon=ICON_ERROR);
wf.send_feedback()
if __name__ == '__main__': # Create a global `Workflow` object wf = Workflow() # Call your entry function via `Workflow.run()` to enable its helper # functions, like exception catching, ARGV normalization, magic # arguments etc. sys.exit(wf.run(main))
